import React from "react";
import Jumbotron from './components/jumbotron';
import jumboData from ',/fixtures/jumbo';

export default function App() {
  return (
    <Jumbotron.Container>
      {jumboData.map((item ) =>(
        <Jumbotron key={item.id} direction={item.direction}>
          <p>Hello!</p>
        </Jumbotron>
      ))}
    </Jumbotron.Container>
  );
}
